module.exports = "<div class=\"privacy\">\n  <div class=\"container\">\n    <h2 class=\"c1\" id=\"h.abrfb1ds6sdl\"><span class=\"c5\">Collection and Use of Personal Information</span></h2>\n    <p class=\"c1\"><span class=\"c0\">Personal information is data that can be used to identify or contact a single\n        person.</span></p>\n    <p class=\"c1\"><span class=\"c6\">You may be asked to provide your personal information anytime you are in contact with\n        Cardboard</span><span class=\"c2\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=https://www.apple.com/legal/privacy/en/affiliated-company/&amp;sa=D&amp;ust=1576097817752000\">&nbsp;</a></span><span\n        class=\"c13\">or a Cardboard Affiliated company</span><span class=\"c0\">&nbsp;Cardboard and its affiliates may\n        share this personal information with each other and use it consistent with this Privacy Policy. They may\n        also combine it with other information to provide and improve our products, services, content, and\n        advertising. You are not required to provide the personal information that we have requested, but, if you\n        chose not to do so, in many cases we will not be able to provide you with our products or services or\n        respond to any queries you may have.</span></p>\n    <p class=\"c1\"><span class=\"c0\">Here are some examples of the types of personal information Cardboard may collect and\n        how we may use it:</span></p>\n    <h3 class=\"c1\" id=\"h.k8j9nvs61mtm\"><span class=\"c11\">What personal information we collect</span></h3>\n    <ul class=\"c10 lst-kix_n7uqah4896we-0 start\">\n      <li class=\"c4\"><span class=\"c0\">When you create a Cardboard ID, download our app, &nbsp;purchase a product,\n          download a software update, register to receive a Cardboard Card File &nbsp;from an introduction or\n          invitation , connect to our services, contact us including by social media or participate in an online\n          survey, we may collect a variety of information, including your name, mailing address, phone number,\n          email address, contact preferences, device identifiers, IP address, location information, credit card\n          information and profile information where the contact is via social media.</span></li>\n      <li class=\"c4\"><span class=\"c0\">When you share your content with family and friends using Cardboard products, send\n          gift certificates and products, or invite others to participate in Cardboard services or forums, Cardboard\n          may collect the information you provide about those people such as name, mailing address, email address,\n          and phone number. Cardboard will use such information to fulfill your requests, provide the relevant\n          product or service, or for anti-fraud purposes.</span></li>\n      <li class=\"c4\"><span class=\"c0\">In certain jurisdictions, we may ask for a government issued ID in limited\n          circumstances including when setting up an account and activating your device, managing reservations, or\n          as required by law.</span></li>\n    </ul>\n    <h3 class=\"c1\" id=\"h.n0ejglmx7t1c\"><span class=\"c11\">How we use your personal information</span></h3>\n    <p class=\"c14\"><span class=\"c0 c12\">We may process your personal information: for the purposes described in this\n        Privacy Policy, with your consent, for compliance with a legal obligation to which Cardboard is subject, for\n        the performance of a contract to which you are party, in order to protect your vital interests, or when we\n        have assessed it is necessary for the purposes of the legitimate interests pursued by Cardboard or a third\n        party to whom it may be necessary to disclose information. If you have questions about this legal basis you\n        can contact the European Data Protection Officer.</span></p>\n    <ul class=\"c10 lst-kix_thu5bynz408j-0 start\">\n      <li class=\"c4\"><span class=\"c0\">The personal information we collect allows us to keep you posted on\n          Cardboard&rsquo;s latest product announcements, software updates, and upcoming events. If you don&rsquo;t\n          want to be on our mailing list, you can opt-out anytime.</span></li>\n      <li class=\"c4\"><span class=\"c0\">We also use personal information to help us create, develop, operate, deliver,\n          and improve our products, services, content and advertising, and for loss prevention and anti-fraud\n          purposes. We may also use your personal information for account and network security purposes, including\n          in order to protect our services for the benefit of all our users, and pre-screening or scanning\n          uploaded content for potentially illegal content, including child sexual exploitation material. Where we\n          use your information for anti-fraud purposes it arises from the conduct of an online transaction with\n          us. We limit our uses of data for anti-fraud purposes to those which are strictly necessary and within\n          our assessed legitimate interests to protect our customers and our services. For certain online\n          transactions we may also validate the information provided by you with publicly accessible\n          sources.</span></li>\n      <li class=\"c4\"><span class=\"c0\">We may use your personal information, including date of birth, to verify\n          identity, assist with identification of users, and to determine appropriate services. For example, we\n          may use date of birth to determine the age of Cardboard ID account holders.</span></li>\n      <li class=\"c4\"><span class=\"c0\">From time to time, we may use your personal information to send important\n          notices, such as communications about purchases and changes to our terms, conditions, and policies.\n          Because this information is important to your interaction with Cardboard you may not opt out of receiving\n          these communications.</span></li>\n      <li class=\"c4\"><span class=\"c0\">We may also use personal information for internal purposes such as auditing,\n          data analysis, and research to improve Cardboard&rsquo;s products, services, and customer\n          communications.</span></li>\n      <li class=\"c4\"><span class=\"c0\">If you enter into a sweepstake, contest, or similar promotion we may use the\n          information you provide to administer those programs.</span></li>\n      <li class=\"c4\"><span class=\"c0\">If you apply for a position at Cardboard or we receive your information in\n          connection with a potential role at Cardboard, we may use your information to evaluate your candidacy and\n          to contact you. If you are a candidate, you will receive more information about how Cardboard handles\n          candidate personal information at the time of application.</span></li>\n    </ul>\n    <h3 class=\"c1\" id=\"h.5pbjfq28atqp\"><span class=\"c11\">Source of your personal information where they are not\n        collected from you</span></h3>\n    <p class=\"c1\"><span class=\"c0\">We may have received your personal information from other persons if that person has\n        shared their content with you using Cardboard products, sent gift certificates and products, or invited you to\n        participate in Cardboard services or forums. We may also validate the information provided by you when\n        creating an Cardboard ID with a third party for security and fraud prevention purposes.</span></p>\n    <p class=\"c1\"><span class=\"c0\">If you are a potential candidate for employment with Cardboard, we may have received\n        your personal information from third parties such as recruiters or external websites. We will use the\n        personal information we receive to contact you about a potential opportunity or in evaluating your\n        candidacy. If you did not provide us your personal information directly, we will inform you of the source\n        when we first contact you regarding your candidacy. For research and development purposes, we may use\n        datasets such as those that contain images, voices or other data that could be associated with an\n        identifiable person. When acquiring such datasets, we do so in accordance with applicable law in the\n        jurisdiction in which the dataset is hosted. When using such datasets for research and development, we do\n        not attempt to re-identify individuals who may appear therein.</span></p>\n    <h2 class=\"c1\" id=\"h.ilp4tox4z8o8\"><span class=\"c5\">Collection and Use of Non-Personal Information</span></h2>\n    <p class=\"c1\"><span class=\"c0\">We also collect data in a form that does not, on its own, permit direct association\n        with any specific individual. We may collect, use, transfer, and disclose non-personal information for any\n        purpose. The following are some examples of non-personal information that we collect and how we may use\n        it:</span></p>\n    <ul class=\"c10 lst-kix_iod1ilxj51fu-0 start\">\n      <li class=\"c4\"><span class=\"c0\">We may collect information such as occupation, language, zip code, area code,\n          unique device identifier, referrer URL, location, and the time zone where a Cardboard product is used so\n          that we can better understand customer behavior and improve our products, services, and\n          advertising.</span></li>\n      <li class=\"c4\"><span class=\"c0\">We may collect information regarding customer activities on our website, iCloud\n          services, App Store and from our other products and services. This information is aggregated and used to\n          help us provide more useful information to our customers and to understand which parts of our website,\n          products, and services are of most interest. Aggregated data is considered non&#8209;personal\n          information for the purposes of this Privacy Policy.</span></li>\n      <li class=\"c4\"><span class=\"c0\">We may collect and store details of how you use our services, including search\n          queries. This information may be used to improve the relevancy of results provided by our services.\n          Except in limited instances to ensure quality of our services over the Internet, such information will\n          not be associated with your IP address.</span></li>\n      <li class=\"c4\"><span class=\"c0\">With your explicit consent, we may collect data about how you use your device\n          and applications in order to help app developers improve their apps.</span></li>\n    </ul>\n    <p class=\"c14\"><span class=\"c0 c12\">If we do combine non-personal information with personal information the combined\n        information will be treated as personal information for as long as it remains combined.</span></p>\n    <h2 class=\"c1\" id=\"h.fz0hp9563kal\"><span class=\"c5\">Cookies and Other Technologies</span></h2>\n    <p class=\"c1\"><span class=\"c6\">Cardboard</span><span class=\"c0\">&rsquo;s websites, online services, interactive\n        applications, email messages, and advertisements may use &quot;cookies&quot; and other technologies such as\n        pixel tags and web beacons. These technologies help us better understand user behavior, tell us which parts\n        of our websites people have visited, and facilitate and measure the effectiveness of advertisements and web\n        searches. We treat information collected by cookies and other technologies as non&#8209;personal\n        information. However, to the extent that Internet Protocol (IP) addresses or similar identifiers are\n        considered personal information by local law, we also treat these identifiers as personal information.\n        Similarly, to the extent that non-personal information is combined with personal information, we treat the\n        combined information as personal information for the purposes of this Privacy Policy.</span></p>\n    <p class=\"c1\"><span class=\"c0\">Ads that are delivered by Cardboard&rsquo;s advertising platform may appear in\n        Cardboard\n        News and in the App Store. If you do not wish to receive ads targeted to your interests from Cardboard&#39;s\n        advertising platform, you can choose to enable Limit Ad Tracking, which will opt your Cardboard ID out of\n        receiving such ads regardless of what device you are using. If you enable Limit Ad Tracking on your mobile\n        device, third-party apps cannot use the Advertising Identifier, a non-personal device identifier, to serve\n        you targeted ads. You may still see ads in the App Store or News based on context like your search query or\n        the channel you are reading. In third-party apps, you may see ads based on other information.</span></p>\n    <p class=\"c1\"><span class=\"c0\">Cardboard also uses cookies and other technologies to remember personal information\n        when you use our website, online services, and applications. Our goal in these cases is to make your\n        experience with Cardboard more convenient and personal. For example, knowing your first name lets us welcome\n        you the next time you visit the Cardboard Online Store. Knowing your country and language &minus; and if you\n        are an educator, your school &minus; helps us provide a customized and more useful shopping experience.\n        Knowing someone using your computer or device has shopped for a certain product or used a particular service\n        helps us make our advertising and email communications more relevant to your interests. And knowing your\n        contact information, hardware identifiers, and information about your computer or device helps us\n        personalize your operating system, set up your Cardboard service, and provide you with better customer\n        service.</span></p>\n    <p class=\"c1\"><span class=\"c0\">If you want to disable cookies and you&rsquo;re using the Safari web browser, go to\n        Safari preferences and then to the privacy pane to manage your preferences. On your Cardboard mobile device,\n        go to Settings, then Safari, scroll down to the Privacy &amp; Security section, and tap on &ldquo;Block\n        Cookies&rdquo; to manage your preferences. For other browsers, check with your provider to find out how to\n        disable cookies. Please note that certain features of the Cardboard website will not be available once cookies\n        are disabled.</span></p>\n    <p class=\"c1\"><span class=\"c0\">As is true of most internet services, we gather some information automatically and\n        store it in log files. This information includes Internet Protocol (IP) addresses, browser type and\n        language, Internet service provider (ISP), referring and exit websites and applications, operating system,\n        date/time stamp, and clickstream data. We use this information to understand and analyze trends, to\n        administer the site, to learn about user behavior on the site, to improve our product and services, and to\n        gather demographic information about our user base as a whole. Cardboard may use this information in our\n        marketing and advertising services.</span></p>\n    <p class=\"c1\"><span class=\"c0\">In some of our email messages, we use a &ldquo;click-through URL&rdquo; linked to\n        content on the Cardboard website. When customers click one of these URLs, they pass through a separate web\n        server before arriving at the destination page on our website. We track this click-through data to help us\n        determine interest in particular topics and measure the effectiveness of our customer communications. If you\n        prefer not to be tracked in this way, you should not click text or graphic links in the email messages.\n        Pixel tags enable us to send email messages in a format customers can read, and they tell us whether mail\n        has been opened. We may use this information to reduce or eliminate messages sent to customers.</span></p>\n    <h2 class=\"c1\" id=\"h.4vlgmeqy9bmb\"><span class=\"c5\">Disclosure to Third Parties</span></h2>\n    <p class=\"c1\"><span class=\"c0\">At times Cardboard may provide third parties with certain personal information to\n        provide or improve our products and services, including to deliver products at your request, or to help\n        Cardboard market to consumers. When we do, we require those third parties to handle it in accordance with\n        relevant laws. Personal information will never be shared with third parties for their marketing purposes.\n        For example, when you activate your account, you authorize Cardboard and your carrier to exchange the\n        information you provide during the activation process to carry out service, including information about your\n        device. If you are approved for service, your account will be governed by Cardboard and your carrier&rsquo;s\n        respective privacy policies.</span></p>\n    <h3 class=\"c1\" id=\"h.iy0iuyv6m54w\"><span class=\"c11\">Service Providers</span></h3>\n    <p class=\"c1\"><span class=\"c6\">Cardboard</span><span class=\"c0\">&nbsp;shares personal information with companies who\n        provide services such as information processing, extending credit, fulfilling customer orders, delivering\n        products to you, managing and enhancing customer data, providing customer service, assessing your interest\n        in our products and services, and conducting customer research or satisfaction surveys. These companies are\n        obligated to protect your information and may be located wherever Cardboard operates.</span></p>\n    <h3 class=\"c1\" id=\"h.nwz2dz9tzrog\"><span class=\"c11\">Others</span></h3>\n    <p class=\"c1\"><span class=\"c0\">It may be necessary &minus; by law, legal process, litigation, and/or requests from\n        public and governmental authorities within or outside your country of residence &minus; for Cardboard to\n        disclose your personal information. We may also disclose information about you if we determine that for\n        purposes of national security, law enforcement, or other issues of public importance, disclosure is\n        necessary or appropriate. We may also disclose information about you, but only where there is a lawful basis\n        for doing so, if we determine that disclosure is reasonably necessary to enforce our terms and conditions or\n        protect our operations or users. &nbsp;This could include providing information to public or governmental\n        authorities. Additionally, in the event of a reorganization, merger, or sale we may transfer any and all\n        personal information we collect to the relevant third party.</span></p>\n    <h2 class=\"c1\" id=\"h.cqt2ua1d7g7c\"><span class=\"c5\">Protection of Personal Information</span></h2>\n    <p class=\"c1\"><span class=\"c6\">Cardboard</span><span class=\"c0\">&nbsp;takes the security of your personal\n        information\n        very seriously. Cardboard online services protect your personal information during transit using encryption\n        such as Transport Layer Security (TLS). When your personal data is stored by Cardboard, we use computer\n        systems with limited access housed in facilities using physical security measures. With the exception of how\n        you store shared Cardboard Files, data is stored in encrypted form including when we utilize third-party\n        storage.</span></p>\n    <p class=\"c1\"><span class=\"c0\">When you use some Cardboard products, services, or applications or post on a\n        Cardboard\n        forum, chat room, or social networking service, the personal information and content you share is visible to\n        other users and can be read, collected, or used by them. You are responsible for the personal information\n        you choose to share or submit in these instances. For example, if you list your name and email address in a\n        forum posting, that information is public. Please take care when using these features.</span></p>\n    <p class=\"c1\"><span class=\"c6\">If you or anyone else using Family Sharing logs on to a device that is owned by a\n        third party, any information shared within your Family&mdash;including calendar, location, photos, and\n        iTunes purchases&mdash;may be downloaded on to that third-party device thereby disclosing any such shared\n        information. Visit </span><span class=\"c2\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=https://www.apple.com/icloud/family-sharing/&amp;sa=D&amp;ust=1576097817760000\">Family\n          Sharing</a></span><span class=\"c0\">&nbsp;for more information.</span></p>\n    <h2 class=\"c1\" id=\"h.5fo486mftkkf\"><span class=\"c5\">The Existence of Automated Decision-Making, Including\n        Profiling</span></h2>\n    <p class=\"c1\"><span class=\"c6\">Cardboard</span><span class=\"c0\">&nbsp;does not take any decisions involving the use\n        of\n        algorithms or profiling that significantly affects you.</span></p>\n    <h2 class=\"c1\" id=\"h.3bzybxjc3i77\"><span class=\"c5\">Integrity and Retention of Personal Information</span></h2>\n    <p class=\"c1\"><span class=\"c6\">Cardboard</span><span class=\"c0\">&nbsp;makes it easy for you to keep your personal\n        information accurate, complete, and up to date. We will retain your personal information for the period\n        necessary to fulfill the purposes outlined in this Privacy Policy and our service specific privacy\n        summaries. When assessing these periods we carefully examine our need to collect personal information at all\n        and if we establish a relevant need we only retain it for the shortest possible period to realize the\n        purpose of collection unless a longer retention period is required by law.</span></p>\n    <h2 class=\"c1\" id=\"h.g3gmb88waj3z\"><span class=\"c5\">Access to Personal Information</span></h2>\n    <p class=\"c1\"><span class=\"c0\">You can help ensure that your contact information and preferences are accurate,\n        complete, and up to date by signing in to your Cardboard ID account page. For other personal information we\n        hold, we will provide you with access (including a copy) for any purpose including to request that we\n        correct the data if it is inaccurate or delete the data if Cardboard is not required to retain it by law or\n        for legitimate business purposes.</span></p>\n    <p class=\"c1\"><span class=\"c6\">We may decline to process requests that are frivolous/vexatious, jeopardize the\n        privacy of others, are extremely impractical, or for which access is not otherwise required by local law. We\n        may also decline aspects of deletion or access requests if we believe doing so would undermine our\n        legitimate use of data for anti-fraud and security purposes as described earlier. Online tools for the\n        exercise of access, deactivation/restriction, correction, or deletion requests are available on a regional\n        basis by signing in to</span><span class=\"c8\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=https://cboard.app&amp;sa=D&amp;ust=1576097817762000\">&nbsp;cboard.app</a></span><span\n        class=\"c6\">. Where the online tool is not currently available for access requests in your region, a request\n        may be made directly to </span><span class=\"c8\"><a class=\"c3\" href=\"mailto:info@cboard.app\">cboard.app via\n          email</a></span><span class=\"c0\">.</span></p>\n    <h2 class=\"c1\" id=\"h.5wc8xma8jxt6\"><span class=\"c5\">Children &amp; Education</span></h2>\n    <p class=\"c1\"><span class=\"c6\">We understand the importance of taking extra precautions to protect the privacy and\n        safety of children using Cardboard products and services. Children under the age of 13, or equivalent minimum\n        age in the relevant jurisdiction, are not permitted to create their own Cardboard IDs, unless their parent\n        provided verifiable consent or as part of the child account creation process in Family Sharing or they have\n        obtained a Managed Cardboard ID account (where available) through their school. For example, a parent must\n        review the Apple</span><span class=\"c2\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=https://www.apple.com/legal/privacy/en-ww/parent-disclosure/&amp;sa=D&amp;ust=1576097817764000\">&nbsp;ID\n          and Family Sharing Disclosure</a></span><span class=\"c6\">&nbsp;and agree to the </span><span class=\"c2\"><a\n          class=\"c3\"\n          href=\"https://www.google.com/url?q=https://www.apple.com/legal/privacy/en-ww/parent-disclosure/%23consent&amp;sa=D&amp;ust=1576097817764000\">Consent\n          to Apple&rsquo;s Collection, Use and Disclosure of Your Child&rsquo;s Information</a></span><span class=\"c6\">;\n        and the </span><span class=\"c2\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=https://www.apple.com/legal/internet-services/itunes/&amp;sa=D&amp;ust=1576097817764000\">iTunes\n          Store Terms and Conditions</a></span><span class=\"c6\">, before they can begin the Cardboard ID account\n        creation process for their child. In addition, schools that participate in Cardboard School Manager and have\n        reviewed and consented to the Managed Cardboard IDs for Students Disclosure may create Managed Cardboard IDs for\n        students. The </span><span class=\"c2\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=https://www.apple.com/legal/education/apple-school-manager/&amp;sa=D&amp;ust=1576097817765000\">Managed\n          Apple IDs for Students Disclosure</a></span><span class=\"c6\">&nbsp;describes how Cardboard handles student\n        information and supplements Cardboard&rsquo;s Privacy Policy. Learn more about </span><span class=\"c2\"><a\n          class=\"c3\"\n          href=\"https://www.google.com/url?q=https://www.apple.com/icloud/family-sharing/&amp;sa=D&amp;ust=1576097817765000\">Family\n          Sharing</a></span><span class=\"c6\">, the </span><span class=\"c2\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=https://www.apple.com/education/it/&amp;sa=D&amp;ust=1576097817766000\">Managed\n          Apple IDs</a></span><span class=\"c6\">&nbsp;and </span><span class=\"c2\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=https://support.apple.com/en-us/HT201304&amp;sa=D&amp;ust=1576097817766000\">Restrictions</a></span><span\n        class=\"c0\">&nbsp;for children&rsquo;s accounts. If we learn that we have collected the personal information\n        of a child under 13, or equivalent minimum age depending on jurisdiction, outside the above circumstances we\n        will take steps to delete the information as soon as possible. If at any time a parent needs to access,\n        correct, or delete data associated with their Family Sharing account or child&rsquo;s Cardboard ID, they may\n        contact us through one of the options provided at the bottom of this page.</span></p>\n    <h2 class=\"c1\" id=\"h.qumwfl6n05sx\"><span class=\"c5\">Location-Based Services</span></h2>\n    <p class=\"c1\"><span class=\"c0\">To provide location-based services on Cardboard products, Cardboard and our partners\n        and\n        licensees, such as maps data providers, may collect, use, and share precise location data, including the\n        real-time geographic location of your Cardboard computer or device. Where available, location-based services\n        may use GPS, Bluetooth, and your IP Address, along with crowd-sourced Wi-Fi hotspot and cell tower\n        locations, and other technologies to determine your devices&rsquo; approximate location. Unless you provide\n        consent, this location data is collected anonymously in a form that does not personally identify you and is\n        used by Cardboard and our partners and licensees to provide and improve location-based products and services.\n        For example, your device may share its geographic location with application providers when you opt in to\n        their location services.</span></p>\n    <p class=\"c1\"><span class=\"c0\">Some location-based services offered by Cardboard, such as the &ldquo;Find My&rdquo;\n        feature, require your personal information for the feature to work.</span></p>\n    <h2 class=\"c1\" id=\"h.g05k0eplglk3\"><span class=\"c5\">Third&#8209;Party Sites and Services</span></h2>\n    <p class=\"c1\"><span class=\"c6\">Cardboard</span><span class=\"c0\">&nbsp;websites, products, applications, and services\n        may contain links to third-party websites, products, and services. Our products and services may also use or\n        offer products or services from third parties &minus; for example, a third&#8209;party iPhone app.</span>\n    </p>\n    <p class=\"c1\"><span class=\"c0\">Information collected by third parties, which may include such things as location\n        data or contact details, is governed by their privacy practices. We encourage you to learn about the privacy\n        practices of those third parties.</span></p>\n    <p class=\"c1\"><span class=\"c0\">If you purchase a subscription in a third party app or within News, we create a\n        Subscriber ID that is unique to you and the developer or publisher which we use to provide reports to the\n        developer or publisher that include information about the subscription you purchased, and your country of\n        residence. If you cancel all of your subscriptions with a particular developer or publisher, the Subscriber\n        ID will reset after 180 days if you do not resubscribe. This information is provided to developers so that\n        they can understand the performance of their subscriptions.</span></p>\n    <h2 class=\"c1\" id=\"h.a9kfipllrr1o\"><span class=\"c5\">International Users</span></h2>\n    <p class=\"c1\"><span class=\"c6\">All the information you provide may be transferred or accessed by entities around the\n        world as described in this Privacy Policy. Personal information, relating to Cardboard services, regarding\n        individuals who reside in a member state of the European Economic Area and Switzerland is controlled by\n        Cardboard Distribution International in Ireland, and processed on its behalf by Cardboard Inc. Cardboard uses\n        approved </span><span class=\"c2\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=https://ec.europa.eu/info/law/law-topic/data-protection/international-dimension-data-protection/standard-contractual-clauses-scc_en&amp;sa=D&amp;ust=1576097817769000\">Model\n          Contractual Clauses</a></span><span class=\"c0\">&nbsp;for the international transfer of personal\n        information collected in the European Economic Area and Switzerland. Cardboard, as a global company, has a\n        number of legal entities in different jurisdictions which are responsible for the personal information which\n        they collect and which is processed on their behalf by Cardboard Inc. For example, point of sale information\n        in our Retail entities outside the U.S. is controlled by our individual Retail entities in each country.\n        Cardboard, Online Store and iTunes related personal information may also be controlled by legal entities\n        outside the U.S. as reflected in the terms of each service. Imagery and associated data collected by Cardboard\n        around the world to improve Cardboard Maps, and in support of our Look Around feature is transferred to\n        Cardboard Inc in California.</span></p>\n    <p class=\"c1\"><span class=\"c6\">Cardboard abides by the </span><span class=\"c2\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=http://www.apec.org/Groups/Committee-on-Trade-and-Investment/~/media/Files/Groups/ECSG/CBPR/CBPR-PoliciesRulesGuidelines.ashx&amp;sa=D&amp;ust=1576097817770000\">Asia-Pacific\n          Economic Cooperation (APEC) Cross Border Privacy Rules System</a></span><span class=\"c6\">. The APEC CBPR\n        system provides a framework for organizations to ensure protection of personal information transferred among\n        participating APEC economies. If you have an unresolved privacy or data use concern regarding our APEC CBPR\n        and/or PRP certifications please visit our </span><span class=\"c2\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=https://feedback-form.truste.com/watchdog/request&amp;sa=D&amp;ust=1576097817770000\">third-party\n          dispute resolution provider</a></span><span class=\"c0\">.</span></p>\n    <h2 class=\"c1\" id=\"h.xdc8j5lqcdoq\"><span class=\"c5\">Our Company wide Commitment to Your Privacy</span></h2>\n    <p class=\"c1\"><span class=\"c0\">To make sure your personal information is secure, we communicate our privacy and\n        security guidelines to Cardboard employees and strictly enforce privacy safeguards within the company.</span>\n    </p>\n    <h2 class=\"c1\" id=\"h.vc2b32sdkn4e\"><span class=\"c5\">Privacy Questions</span></h2>\n    <p class=\"c1\"><span class=\"c6\">If you have any questions or concerns about Cardboard&rsquo;s Privacy Policy or data\n        processing, you would like to contact our European Data Protection Officer, or if you would like to make a\n        complaint about a possible breach of local privacy laws, please </span><span class=\"c2\"><a class=\"c3\"\n          href=\"https://www.google.com/url?q=https://www.cboard.app/legal/privacy/en-ww/contact/&amp;sa=D&amp;ust=1576097817772000\">contact\n          us</a></span><span class=\"c6\">. You can always contact us by phone at the relevant </span><span class=\"c2\"><a\n          class=\"c3\"\n          href=\"https://www.google.com/url?q=https://support.apple.com/en-us/HT201232&amp;sa=D&amp;ust=1576097817772000\">Cardboard\n          Support</a></span><span class=\"c0\">&nbsp;number for your country or region.</span></p>\n    <p class=\"c1\"><span class=\"c0\">When a privacy question or question about personal information received in response\n        to an access/download request is received we have a dedicated team which triages your contact to address\n        your issue. Where your issue may be more substantive in nature, we may request more information from you.\n        All such substantive contacts receive a response within seven (7), days wherever possible - providing a\n        response on the issue raised, requesting additional information where necessary or indicating that a\n        response will require additional time. You may at any time refer your complaint to the relevant regulator in\n        your jurisdiction if you are unsatisfied with a reply received from us. If you ask us, we will endeavor to\n        provide you with information about relevant complaint avenues which may be applicable to your\n        circumstances.</span></p>\n    <p class=\"c1\"><span class=\"c0\">Where your complaint indicates an improvement could be made in our handling of\n        privacy issues we will take steps to make such an update at the next reasonable opportunity. In the event\n        that a privacy issue has resulted in a negative impact on you or another person we will take steps to\n        address that with you or that other person.</span></p>\n    <p class=\"c1\"><span class=\"c0\">Cardboard may update its Privacy Policy from time to time. When we change the policy\n        in\n        a material way, a notice will be posted on our website along with the updated Privacy Policy. We will also\n        contact you via your contact information on file, for example by email, notification or some other\n        equivalent method. </span></p>\n    <p class=\"c1\"><span class=\"c0\">Cardboard Is a service mark of www realestate &reg; incorporated. 464 Commonwealth\n        Avenue Boston MA 02215</span></p>\n    <p class=\"c7\"><span class=\"c15\"></span></p>\n  </div>\n</div>"

